import React from "react";
import BootstrapTable from "react-bootstrap-table-next";
import filterFactory, { textFilter } from "react-bootstrap-table2-filter";
import paginationFactory from "react-bootstrap-table2-paginator";
import ToolkitProvider, { Search } from "react-bootstrap-table2-toolkit";

import "react-bootstrap-table2-toolkit/dist/react-bootstrap-table2-toolkit.min.css";

import { Card } from "react-bootstrap";

const { SearchBar } = Search;

const products = [
  {
    id: 1,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 2,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 3,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 4,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 5,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  { id: 6, name: "abhishek", email: "abcd@gmail.com" },
];

const columns = [
  {
    dataField: "SlNo",
    text: "#",
  },
  {
    dataField: "name",
    text: "Name",
    filter: textFilter(),
    sort: true,
  },
  {
    dataField: "email",
    text: "Email",
    filter: textFilter({}),
    sort: true,
  },
  {
    dataField: "price",
    text: "Created At",
    filter: textFilter(),
  },
  {
    dataField: "price2",
    text: "Updated At",
    filter: textFilter(),
  },
  {
    dataField: "price1",
    text: "Action",
    formatter: (cell, row, rowIndex) => {
      return (
        <button onClick={(e) => alert(row.id)} className="btn btn-success">
          View
        </button>
      );
    },
  },
];

function home() {
  const noData = (
    <div className="text-muted py-3 text-center"> Sorry No Data..</div>
  );

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-12 p-5">
          <ToolkitProvider keyField="id" data={products} columns={columns}>
            {(props) => (
              <Card>
                <BootstrapTable
                 { ...props.baseProps }
                  keyField="id"
                  data={products}
                  columns={columns}
                  noDataIndication={noData}
                  filter={filterFactory()}
                  pagination={paginationFactory()}
                />
              </Card>
            )}
          </ToolkitProvider>
        </div>
      </div>
    </div>
  );
}

export default home;
